public class IsSubsequence {
    public static boolean isSubsequence(String s, String t) {
        int slen = s.length();
        int tlen = t.length();
        boolean[][] F = new boolean[slen+1][tlen+1];

        String[] sary = s.split("");
//        String[] tary = t.split("");

        for(int i = 0; i<=tlen; i++) {
            F[0][i] = true;
        }

        /**
         * F[n, k] = F[n-1, n-1] & w(n, n ...... k) || F[n, n......k]
         *           F[n-1, n] & w(n, n + 1 ...... k) || F[n, n......k]
         *           ....
         *           F[n-1, k-1] & w(n, k) || F[n, n......k]
         *
         */
        for (int i = 1; i<=slen; i ++) {
            for (int j = i; j<=tlen; j++) {
                F[i][j] = F[i][j-1];
                if (F[i-1][j-1]) {
                    String tmpT = t.substring(j - 1);
                    int matchIndex  = tmpT.indexOf(sary[i-1]);
//                    System.out.println("matchIndex : " + matchIndex + " , " + tmpT + " i " + i + " j " + j + " sary[i] "+ sary[i-1]);
                    if (matchIndex > -1) {
                        F[i][j+matchIndex] = true;
                    }
                }
            }
        }

//        output(F);


        for(int i = 1; i<=tlen; i++){
            if (F[slen][i]) {
                return true;
            }
        }

        return false;

    }

    public static void output(boolean[][] matrix) {
        for (int i = 0; i < matrix.length; i++) {
            for (int j = 0; j < matrix[i].length; j++) {
                System.out.print(matrix[i][j] + "\t");
            }
            System.out.println();
        }
    }

    public static boolean isSubsequenceNorm(String s, String t) {
        int slen = s.length();
        String[] sary = s.split("");
        int index = 0;
        for (int i = 0; i < slen; i++) {
            String tmpT = t.substring(index);
            int matchIndex = tmpT.indexOf(sary[i]);

            System.out.println("matchIndex : " + matchIndex + " , " + tmpT + " i " + i + " sary[i] "+ sary[i]);

            if (matchIndex > -1) {
                index = index + matchIndex + 1;
            } else {
                return false;
            }
        }
        return true;
    }

    public static void main (String[] args) {
//        String s = "sss";
//        String t = "eesss";
//        String s = "pppsppuppppbsppppppppppppppppppppepppppppppppqpupppepppppppppppppppnpppppppcppppppppppppeppppppppppp";
//        String t = "";
        String s =  "leeeeetcode";
        String t = "";
        boolean res = isSubsequenceNorm(s, t);
        System.out.println("sss " + res);
    }
}
